import React, { Component } from 'react'
import { Redirect } from 'react-router-dom'


export default function Card (props) {
    return (
        	<div class="card">
              <div class="card-header">
      			<strong>{props.user.name} asks </strong>
              </div>
             <div class="card flex-row">
				<img src={props.user.avatarURL} alt={`Avatar of ${props.user.name}`} 
                className='card-img-left example-card-img-responsive'/> : null}
        		<img class="card-img-left example-card-img-responsive" src="/postboot/assets/img/thumbnail.jpg"/>
                <div class="card-body">
                  <h4 class="card-title h5 h4-sm">Left image</h4>
                  <p class="card-text">Example text</p>
                </div>
              </div>
            </div>
  )
}
